import React, { useState } from 'react';
import { Container } from 'react-bootstrap';
import { Button } from 'react-bootstrap';
import CreateService from '../components/modals/CreateService';
import CreateTroublescore from '../components/modals/CreateTroublescore';
import CreateType from '../components/modals/CreateType';

const Admin = () => {
  const [troublescoreVisible, setTroublescoreVisible] = useState(false)
  const [typeVisible, setTypeVisible] = useState(false)
  const [serviceVisible, setServiceVisible] = useState(false)
  return (
    <Container className="d-flex flex-column">
    <Button variant={"outline-dark"} className="mt-4 p-2">Добавить тип</Button>
    <Button variant={"outline-dark"} className="mt-4 p-2">Добавить сложность</Button>
    <Button variant={"outline-dark"} className="mt-4 p-2">Добавить услугу</Button>

    <CreateTroublescore show = {troublescoreVisible}/>
    <CreateService show = {serviceVisible}/>
    <CreateType show={typeVisible}/>
    </Container>
  );
};

export default  Admin;
